import logo from "../../assets/images/logo/logo.png";
import cover from "../../assets/images/banner.webp";
import "./UsersPage.css";
import Button from "../../components/Button/Button.js";
import tirunelveli from "../../assets/images/thanjavur.png";

export default function UsersPage() {
    const fetchData = () => {
        fetch('https://nijin-server.vercel.app/api/explorer')
          .then(response => {
            if (!response.ok) {
              throw new Error('Network response was not ok');
            }
            return response.json();
          })
          .then(data => {
            console.log(data); // Log the data to the console
            setData(data);
          })
          .catch(error => {
            console.error('Error fetching data:', error);
          });
      };

fetchData();
  return (
    <>
      {/* header section */}
      <div className="header">
        <div className="image-container">
          <img src={logo} alt="logoImage" />
        </div>
        <div className="menu-container">
          <ul>
            <li>Hotels</li>
            <li>Bikes</li>
            <li>Restraunts</li>
          </ul>
        </div>
      </div>
      {/* Promo and search section */}
      <div className="promo-section">
        <div className="explorer-section">
          <p className="explorer-heading">WELCOME TO EXPLORER</p>
          <p className="explorer-description">
            Your Adventure Travel Expert in the <span>SOUTH</span>
          </p>
          <select className="city" name="shirt_color" label="Shirt Color:">
            <option value="">Choose</option>
            <option value="red">Red</option>
            <option value="yellow">Yellow</option>
            <option value="purple">Purple</option>
            <option value="blue">Blue</option>
            <option value="green">Green</option>
            <option value="orange">Orange</option>
          </select>

          <Button className="explorer-button" label={"EXPLORE"}></Button>
        </div>
        <div className="explorer-image">
          <img src={cover} alt="coverImage" />
        </div>
      </div>

      {/* destination  section */}
          <div className="destination-section">
            <p className="destination-heading">Destinations</p>
            <p className="destination-content">Just for vou. Because vou and vour bike are special to us!</p>
            <div className="container">
                <div className="cards">
                    <img src={tirunelveli} alt="bab"/>
                </div>

            </div>

          </div>

    </>
  );
}
